    E1_0(:,i) = Ret_TopThree(T01 * T12 * T23 * [E1_3(:,i);1]);
    E2_0(:,i) = Ret_TopThree(T01 * T12 * T23 * [E2_3(:,i);1]);
    E3_0(:,i) = Ret_TopThree(T01 * T12 * T23 * [E3_3(:,i);1]);


    F1_4(:,i) = Ret_TopThree(T45 * [F1_5(:,i);1]);
    F2_4(:,i) = Ret_TopThree(T45 * [F2_5(:,i);1]);
    F3_4(:,i) = Ret_TopThree(T45 * [F3_5(:,i);1]);

    F1_0(:,i) = Ret_TopThree(T01 * T12 * T23 * T34 * [F1_4(:,i);1]);
    F2_0(:,i) = Ret_TopThree(T01 * T12 * T23 * T34 * [F2_4(:,i);1]);
    F3_0(:,i) = Ret_TopThree(T01 * T12 * T23 * T34 * [F3_4(:,i);1]);


    G1_5(:,i) = Ret_TopThree(T56 * [G1_6(:,i);1]);
    G2_5(:,i) = Ret_TopThree(T56 * [G2_6(:,i);1]);
    G3_5(:,i) = Ret_TopThree(T56 * [G3_6(:,i);1]);

    G1_0(:,i) = Ret_TopThree(T01 * T12 * T23 * T34 * T45 * [G1_5(:,i);1]);
    G2_0(:,i) = Ret_TopThree(T01 * T12 * T23 * T34 * T45 * [G2_5(:,i);1]);
    G3_0(:,i) = Ret_TopThree(T01 * T12 * T23 * T34 * T45 * [G3_5(:,i);1]); 

    H0_0(:,i) = Ret_TopThree(T01 * T12 * T23 * T34 * T45 * T56 * [H0_6(:,i);1]);


    % 底层中心点
    A0_0(1,i) = (A1_0(1,i)+A2_0(1,i)+A3_0(1,i))/3;
    A0_0(2,i) = (A1_0(2,i)+A2_0(2,i)+A3_0(2,i))/3;
    A0_0(3,i) = (A1_0(3,i)+A2_0(3,i)+A3_0(3,i))/3;
    % 第一层中心点
    B0_0(1,i) = (B1_0(1,i)+B2_0(1,i)+B3_0(1,i))/3;
    B0_0(2,i) = (B1_0(2,i)+B2_0(2,i)+B3_0(2,i))/3;
    B0_0(3,i) = (B1_0(3,i)+B2_0(3,i)+B3_0(3,i))/3;
    % 第二层中心点
    C0_0(1,i) = (C1_0(1,i)+C2_0(1,i)+C3_0(1,i))/3;
    C0_0(2,i) = (C1_0(2,i)+C2_0(2,i)+C3_0(2,i))/3;
    C0_0(3,i) = (C1_0(3,i)+C2_0(3,i)+C3_0(3,i))/3;
    % 第三层中心点
    D0_0(1,i) = (D1_0(1,i)+D2_0(1,i)+D3_0(1,i))/3;
    D0_0(2,i) = (D1_0(2,i)+D2_0(2,i)+D3_0(2,i))/3;
    D0_0(3,i) = (D1_0(3,i)+D2_0(3,i)+D3_0(3,i))/3;
    % 第四层中心点  
    E0_0(1,i) = (E1_0(1,i)+E2_0(1,i)+E3_0(1,i))/3;
    E0_0(2,i) = (E1_0(2,i)+E2_0(2,i)+E3_0(2,i))/3;
    E0_0(3,i) = (E1_0(3,i)+E2_0(3,i)+E3_0(3,i))/3;
    % 第五层中心点
    F0_0(1,i) = (F1_0(1,i)+F2_0(1,i)+F3_0(1,i))/3;
    F0_0(2,i) = (F1_0(2,i)+F2_0(2,i)+F3_0(2,i))/3;
    F0_0(3,i) = (F1_0(3,i)+F2_0(3,i)+F3_0(3,i))/3;
    % 第六层中心点
    G0_0(1,i) = (G1_0(1,i)+G2_0(1,i)+G3_0(1,i))/3;
    G0_0(2,i) = (G1_0(2,i)+G2_0(2,i)+G3_0(2,i))/3;
    G0_0(3,i) = (G1_0(3,i)+G2_0(3,i)+G3_0(3,i))/3;

    %% 驱动杆长度与驱动角度转换雅各比
    P=[0;0;C_s];% 动平台质心在其所在坐标系指向下一层质心位置向量

    % 方向向量为该层下一层的坐标系内
    % 第一层各驱动杆的方向向量
    limb_vector1_1 = B1_0(:,i) + P - A1_0(:,i);
    limb_vector1_2 = B2_0(:,i) + P - A2_0(:,i);
    limb_vector1_3 = B3_0(:,i) + P - A3_0(:,i);

    % 第二层的驱动杆的方向向量
    limb_vector2_1 = C1_1(:,i) + P - B1_1(:,i);
    limb_vector2_2 = C2_1(:,i) + P - B2_1(:,i);
    limb_vector2_3 = C3_1(:,i) + P - B3_1(:,i);

    % 第三层的驱动杆的方向向量
    limb_vector3_1 = D1_2(:,i) + P - C1_2(:,i);
    limb_vector3_2 = D2_2(:,i) + P - C2_2(:,i);
    limb_vector3_3 = D3_2(:,i) + P - C3_2(:,i);

    % 第四层的驱动杆的方向向量
    limb_vector4_1 = E1_3(:,i) + P - D1_3(:,i);
    limb_vector4_2 = E2_3(:,i) + P - D2_3(:,i);
    limb_vector4_3 = E3_3(:,i) + P - D3_3(:,i);

    % 第五层的驱动杆的方向向量
    limb_vector5_1 = F1_4(:,i) + P - E1_4(:,i);
    limb_vector5_2 = F2_4(:,i) + P - E2_4(:,i);
    limb_vector5_3 = F3_4(:,i) + P - E3_4(:,i);   

    % 第六层的驱动杆的方向向量
    limb_vector6_1 = G1_5(:,i) + P - F1_5(:,i);
    limb_vector6_2 = G2_5(:,i) + P - F2_5(:,i);
    limb_vector6_3 = G3_5(:,i) + P - F3_5(:,i); 


    % 第一层驱动杆单位向量
    unit_vector1_1 = limb_vector1_1/sqrt(limb_vector1_1'*limb_vector1_1);
    unit_vector1_2 = limb_vector1_2/sqrt(limb_vector1_2'*limb_vector1_2);
    unit_vector1_3 = limb_vector1_3/sqrt(limb_vector1_3'*limb_vector1_3);

    % 第二层驱动杆单位向量
    unit_vector2_1 = limb_vector2_1/sqrt(limb_vector2_1'*limb_vector2_1);
    unit_vector2_2 = limb_vector2_2/sqrt(limb_vector2_2'*limb_vector2_2);
    unit_vector2_3 = limb_vector2_3/sqrt(limb_vector2_3'*limb_vector2_3);

    % 第三层驱动杆单位向量
    unit_vector3_1 = limb_vector3_1/sqrt(limb_vector3_1'*limb_vector3_1);
    unit_vector3_2 = limb_vector3_2/sqrt(limb_vector3_2'*limb_vector3_2);
    unit_vector3_3 = limb_vector3_3/sqrt(limb_vector3_3'*limb_vector3_3);

    % 第四层驱动杆单位向量
    unit_vector4_1 = limb_vector4_1/sqrt(limb_vector4_1'*limb_vector4_1);
    unit_vector4_2 = limb_vector4_2/sqrt(limb_vector4_2'*limb_vector4_2);
    unit_vector4_3 = limb_vector4_3/sqrt(limb_vector4_3'*limb_vector4_3);
    
    % 第五层驱动杆单位向量
    unit_vector5_1 = limb_vector5_1/sqrt(limb_vector5_1'*limb_vector5_1);
    unit_vector5_2 = limb_vector5_2/sqrt(limb_vector5_2'*limb_vector5_2);
    unit_vector5_3 = limb_vector5_3/sqrt(limb_vector5_3'*limb_vector5_3);

    % 第六层驱动杆单位向量
    unit_vector6_1 = limb_vector6_1/sqrt(limb_vector6_1'*limb_vector6_1);
    unit_vector6_2 = limb_vector6_2/sqrt(limb_vector6_2'*limb_vector6_2);
    unit_vector6_3 = limb_vector6_3/sqrt(limb_vector6_3'*limb_vector6_3);


    % 第一层并联平台构型空间到驱动空间雅克比矩阵
    J_fail1 = [cross(B1_0(:,i),unit_vector1_1)';cross(B2_0(:,i),unit_vector1_2)';cross(B3_0(:,i),unit_vector1_3)'];
    % 第二层并联平台构型空间到驱动空间雅克比矩阵
    J_fail2 = [cross(C1_1(:,i),unit_vector2_1)';cross(C2_1(:,i),unit_vector2_2)';cross(C3_1(:,i),unit_vector2_3)'];
    % 第三层并联平台构型空间到驱动空间雅克比矩阵
    J_fail3 = [cross(D1_2(:,i),unit_vector3_1)';cross(D2_2(:,i),unit_vector3_2)';cross(D3_2(:,i),unit_vector3_3)'];
    % 第四层并联平台构型空间到驱动空间雅克比矩阵
    J_fail4 = [cross(E1_3(:,i),unit_vector4_1)';cross(E2_3(:,i),unit_vector4_2)';cross(E3_3(:,i),unit_vector4_3)'];
