    J_fail5 = [cross(F1_4(:,i),unit_vector5_1)';cross(F2_4(:,i),unit_vector5_2)';cross(F3_4(:,i),unit_vector5_3)'];
    % 第六层并联平台构型空间到驱动空间雅克比矩阵
    J_fail6 = [cross(G1_5(:,i),unit_vector6_1)';cross(G2_5(:,i),unit_vector6_2)';cross(G3_5(:,i),unit_vector6_3)'];

    %% 求驱动杆长度变化
    % 驱动长度偏差
    delta_length(1,:,i) = (J_fail1*[delta_theta(1,:,i)';0])';
    delta_length(2,:,i) = (J_fail2*[delta_theta(2,:,i)';0])';
    delta_length(3,:,i) = (J_fail3*[delta_theta(3,:,i)';0])';
