    delta_length(6,:,i) = (J_fail6*[delta_theta(6,:,i)';0])';

    %% 动力学模型
    % 增益
    kp = 3000;

    % 驱动力
    driving_force(:,:,i) = kp*delta_length(:,:,i);

    % 驱动力矩
    driving_torque(1,:,i) = ([-driving_force(1,1,i)*sqrt(3)/2*R;driving_force(1,1,i)*R/2]+[0;-driving_force(1,2,i)*R]+[driving_force(1,3,i)*sqrt(3)/2*R;driving_force(1,3,i)*R/2])';
    driving_torque(2,:,i) = ([-driving_force(2,1,i)*sqrt(3)/2*R;driving_force(2,1,i)*R/2]+[0;-driving_force(2,2,i)*R]+[driving_force(2,3,i)*sqrt(3)/2*R;driving_force(2,3,i)*R/2])';
