    driving_torque(6,:,i) = ([-driving_force(6,1,i)*sqrt(3)/2*R;driving_force(6,1,i)*R/2]+[0;-driving_force(6,2,i)*R]+[driving_force(6,3,i)*sqrt(3)/2*R;driving_force(6,3,i)*R/2])';    

