    % 角度项系数
    X_theta = [k,0;0,k];

    % 计算当前时刻角加速度
    angular_acceleration(1,:,i) = (pinv(X_angular_acceleration)*(driving_torque(1,:,i)'-X_omega*omega(1,:,i)'-X_theta*theta(1,:,i)'))';
